import './App.css';
import React from 'react';
import Navbar from './components/navbar';
import SearchBox from './components/searchBox';
import Home from './pages/home';
import { AppProvider } from './AppContext'; // Importa el AppProvider desde tu contexto

function App() {
  return (
    <div className='App'>
      <Navbar>
        <SearchBox />
      </Navbar>
      <Home />
    </div>
  );
}

export default function AppWithContext() {
  return (
    <AppProvider>
      <App />
    </AppProvider>
  );
}
